import Note from "../Note/Note";

function AppNote() {

    const [addItem, setAddItem] = useState([]);

    const addNote = (note) => {
        setAddItem((preData) => {
            return [...preData, note]
        })
        console
    }

    return(
        <>
            <Note 
                passNote = {addNote}
            />
        </>
    )
}

export default AppNote;
